import './projects.css';








function projects() {
    return(
        <>
        <div className="project container overflow-auto    rounded-md  max-h-screen" >
            <div className='block  my-10 mx-auto py-3  rounded-md max-w-screen-sm bg-slate-400 shadow-md'>
                <div className="block mx-20 align-middle rounded-md  bg-slate-400 shadow-md" >
                    <img className="block rounded-md min-w-screen-sm "src="https://media.istockphoto.com/id/1398879410/photo/business-woman-looking-at-the-project-management-calendar-in-her-office.webp?b=1&s=170667a&w=0&k=20&c=UqNNit1KbMbjfLgoge4tA7d9-EWOE6AbiotLLBTZi5k=" alt=""></img>
                
                </div>
                <h3 className='text-center text-lg my-4'>Title of project</h3>
               
            </div>
            <div className='block  my-10 mx-auto py-3  rounded-md max-w-screen-sm bg-slate-400 shadow-md'>
                <div className="block mx-20 align-middle rounded-md  bg-slate-400 shadow-md" >
                    <img className="block rounded-md min-w-screen-sm "src="https://media.istockphoto.com/id/1398879410/photo/business-woman-looking-at-the-project-management-calendar-in-her-office.webp?b=1&s=170667a&w=0&k=20&c=UqNNit1KbMbjfLgoge4tA7d9-EWOE6AbiotLLBTZi5k=" alt=""></img>
                
                </div>
                <h3 className='text-center text-lg my-4'>Title of project</h3>
               
            </div>


        </div>
        </>

    );
}

export default projects;
